import React from 'react';
import './Form.css'

class Form extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return <form style="color: red">
                <label>Email ID: <input type="text" name="email"/></label><br/>
                <label>Password: <input type="password" name="password"/></label><br/>
                <label>Confirmation: <input type="password"/></label><br/>
                <input type="submit" value="Sign Up"/>
            </form>
    }
}
export default Form;
